	public static List<String> execPyWithRet(String _strFilename,String... args)
	{
		List<String> ret = new CopyOnWriteArrayList<>();
		File curPathFile = new File("");
		String strCurPath = null;
		Process proc = null;
		try {
			strCurPath = curPathFile.getCanonicalPath();
			String[] strlst = new String[args.length + 3];
			strlst[0] = PY_EXE;
			strlst[1] = strCurPath + "/py/" +_strFilename;
			strlst[2] = strCurPath;
			for(int i = 0;i<args.length;++i)
			{
				strlst[i + 3] = args[i];
			}

			proc = Runtime.getRuntime().exec(strlst);

			BufferedReader br = new BufferedReader(new InputStreamReader(proc.getInputStream()));
			String line = null;
			try {
				while((line = br.readLine()) != null) {
				System.out.println(line);
					ret.add(line);
				}
			} catch (IOException e) {
				// TODO Auto-generated catch block
				e.printStackTrace();
				return null;
			}
			System.out.println(_strFilename + " is out with cmd:"+ Arrays.toString(strlst));

		} catch (Exception e) {
			e.printStackTrace();
		}

		return ret;
	}

